class Migration0002(object):
    """Functions from v1.migrations.0002_share_perms."""

    @staticmethod
    def create_share_permissions(apps, schema_editor):
        ContentType = apps.get_model('contenttypes.ContentType')
        Permission = apps.get_model('auth.Permission')
        Group = apps.get_model('auth.Group')

        try:
            v1_content_type = ContentType.objects.get(
                app_label='v1',
                model='cfgovpage')
        except ContentType.DoesNotExist:
            v1_content_type = ContentType.objects.create(
                app_label='v1',
                model='cfgovpage'
            )

        # Create share permission
        share_permission = Permission.objects.create(
            content_type=v1_content_type,
            codename='share_page',
            name='Can share pages'
        )

        # Assign it to Editors and Moderators groups
        for group in Group.objects.all():
            group.permissions.add(share_permission)


class Migration0011(object):
    """Functions from v1.migrations.0011_hero_refactor_data."""

    @classmethod
    def forwards(cls, apps, schema_editor):
        cls.migrate_heroes(apps, cls.migrate_hero_forwards)

    @classmethod
    def backwards(cls, apps, schema_editor):
        cls.migrate_heroes(apps, cls.migrate_hero_backwards)

    @classmethod
    @transaction.atomic
    def migrate_heroes(cls, apps, mapper):
        page_types_and_stream_fields_with_heroes = [
            ('DemoPage', 'molecules'),
            ('LandingPage', 'header'),
            ('SublandingFilterablePage', 'header'),
            ('SublandingPage', 'header'),
        ]

        for page_type, field_name in page_types_and_stream_fields_with_heroes:
            page_cls = apps.get_model('v1', page_type)
            for page in page_cls.objects.all():
                cls.migrate_page(page, field_name, mapper)

    @classmethod
    def migrate_page(page, field_name, mapper):
        old_stream_data = get_stream_data(page, field_name)
        new_stream_data = []

        migrated = False
        for field in old_stream_data:
            if 'hero' == field['type']:
                field['value'] = mapper(field['value'])
                migrated = True

            new_stream_data.append(field)

        if migrated:
            print('migrated page {}'.format(page.slug))
            set_stream_data(page, field_name, new_stream_data)

    @staticmethod
    def migrate_hero_forwards(data):
        data = dict(data)

        image = (data.get('image') or {}).get('upload')
        background_image = data.pop('background_image', None)

        if background_image:
            data['small_image'] = image
            data['image'] = background_image
        else:
            data['small_image'] = None
            data['image'] = image

        return data

    @staticmethod
    def migrate_hero_backwards(data):
        data = dict(data)

        image = data['image']
        small_image = data.pop('small_image', None)

        data['image'] = None
        data['background_image'] = None

        if image and small_image:
            data['image'] = {'upload': small_image, 'alt': ''}
            data['background_image'] = image
        elif image:
            data['image'] = {'upload': image, 'alt': ''}
        elif small_image:
            data['image'] = {'upload': small_image, 'alt': ''}

        return data


class Migration0013(object):
    """Functions from v1.migrations.0013_update_tables_to_tableblocks."""

    @classmethod
    def create_tableblocks_for_every_table(cls, apps, schema_editor):
        logger.info('Updating tables in content field')
        cf_page_types = (
            'BrowsePage', 'SublandingPage', 'LearnPage', 'DocumentDetailPage',
        )

        for cf_page_type in cf_page_types:
            page_cls = apps.get_model('v1', cf_page_type)
            for p in page_cls.objects.all():
                if cls.update_tables_in_content_field(wagtail_page=p):
                    publish_changes(child=p)

        logger.info('Updating tables in full width text organisms')
        fwt_page_types = (
            'BlogPage', 'BrowseFilterablePage', 'BrowsePage', 'DemoPage',
            'LearnPage', 'SublandingFilterablePage', 'SublandingPage',
        )

        for fwt_page_type in fwt_page_types:
            page_cls = apps.get_model('v1', fwt_page_type)
            for p in page_cls.objects.all():
                if cls.update_tables_in_full_width_text_organisms(
                    wagtail_page=p
                ):
                    publish_changes(child=p)


    @classmethod
    def update_tables_in_content_field(cls, wagtail_page):
        return cls.update_table_items(
            items=wagtail_page.content.stream_data,
            wagtail_page=wagtail_page
        )

    @classmethod
    def update_table_items(cls, items, wagtail_page):
        table_items = list(filter(lambda i: i['type'] == 'table', items))

        for item in table_items:
            item['type'] = 'table_block'
            item['value'] = cls.create_tableblock_data(old_table=item['value'])
            logger.info(
                "Updating Table to a TableBlock on page %s of page type %s"
                % (wagtail_page.title, wagtail_page.__class__.__name__)
            )

        return table_items

    @classmethod
    def create_tableblock_data(cls, old_table):
        table = {u'data': []}
        if 'headers' in old_table.keys():
            first_row = old_table['headers']
            table['data'].append(first_row)
            table['first_row_is_table_header'] = True
        if 'rows' in old_table.keys():
            for row_list in old_table['rows']:
                new_row = []
                for row in row_list:
                    if row['type'] == 'hyperlink':
                        row['value'] = cls.convert_hyperlink_obj_to_text(
                            row['value']
                        )
                    new_row.append(row['value'])
                table['data'].append(new_row)
        return table

    @staticmethod
    def convert_hyperlink_obj_to_text(value):
        """ Taken from cfgov/jinja2/v1/_includes/atoms/hyperlink.html """
        return """<a class='jump-link' href='%s'>%s</a>""" % (
            value['url'],
            value['text']
        )

    @classmethod
    def update_tables_in_full_width_text_organisms(wagtail_page):
        tables = []

        for item in list(filter(
            lambda item: item['type'] == 'full_width_text',
            wagtail_page.content.stream_data
        )):
            sub_items = item['value']
            tables.extend(
                cls.update_table_items(
                    items=sub_items,
                    wagtail_page=wagtail_page
                )
            )

        return tables


class Migration0022(object):
    """Functions from v1.migrations.0022_replace_dup_category_field_data."""

    @classmethod
    def forwards(cls, apps, schema_editor):
        page_types_and_fields = [
            ('v1', 'DocumentDetailPage', 'header', 'item_introduction'),
            ('v1', 'LearnPage', 'header', 'item_introduction'),
            ('v1', 'EventPage', 'header', 'item_introduction'),
            ('v1', 'DemoPage', 'header', 'item_introduction'),
        ]
        migrate_page_types_and_fields(apps, page_types_and_fields,
                                      cls.migrate_category_field_forwards)

    @classmethod
    def backwards(cls, apps, schema_editor):
        page_types_and_fields = [
            ('v1', 'AbstractFilterPage', 'header', 'item_introduction'),
            ('v1', 'DemoPage', 'header', 'item_introduction'),
        ]
        migrate_page_types_and_fields(apps, page_types_and_fields,
                                    cls.migrate_category_field_backwards)

    @staticmethod
    def migrate_category_field_forwards(page_or_revision, data):
        data = dict(data)

        # If the original category field is empty, we take that to mean
        # show_category should be False.
        data['show_category'] = bool(data.pop('category', None))

        return data

    @staticmethod
    def migrate_category_field_backwards(page_or_revision, data):
        data = dict(data)

        # If show_category is true, we need to get the first category from
        # the page settings categories and assign its name to the categories
        # field.
        if data.pop('show_category'):
            if is_page(page_or_revision):
                categories = page_or_revision.categories
            else:
                revision_content = json.loads(page_or_revision.content_json)
                categories = revision_content['categories']

            try:
                data['category'] = categories[0]['name']
            except IndexError:
                # If the page or revision doesn't have any categories, we'll
                # get an IndexError
                data['category'] = ''
        else:
            data['category'] = ''

        return data


